const addUser = (user) => {
    return {
        type: 'NEW_USER',
        payload: user
    }

}

const logout = () => {
    return {
        type: 'LOGOUT'
    }
}

const addToken = (token) => {
    return {
        type: 'ADD_TOKEN',
        payload: token
    }
}

const removeToken = () => {
    return {
        type: 'REMOVE_TOKEN'
    }
}

export {
    addUser,
    logout
}
